import {Link} from 'react-router-dom'

export function BookList(){
    return (
        <>
            <h1>BookList</h1>
            <Link to="/books/1">Book 1</Link>
            <br />
            <Link to="/books/2">Book 2 </Link>
            <br />
            <Link to="/books/bew">New Book</Link>
        </>
    )
}
